export default function Dish({title, price, img}){
  return(
    <div className="dish">
      <img src={`./static/${img}`} alt={title} height="130px" width="130px"/>
      <div className="dish_info">
        <h2>{title}</h2>
        <p>{price} uah</p>
        <button>Add</button>
      </div>
    </div>
  );
}
